import React from 'react';
import Carts from './Carts';


function PhotoWall(props) {
    return (
        <div className='photoGrid'>
            {props.bivakzones.map((post, index) => <Carts key={index} post={post} />)}
        </div>
    )
}

export default PhotoWall;
